import { useEffect } from 'react'
import '../ComponentStyles/countryDisplayComponent.css'

function CountryDisplayComponent({viewCountries}) {

    useEffect(() => {console.log(viewCountries)}, [viewCountries]);
    return (
        <div className="country-display-container">
            <SingleCountryView country={viewCountries} />
        </div>
    )
}

function DefaultCountryView() {
    return (
        <div className='default-view-country'>
            <h2>Search For a Country</h2>
        </div>
    )
}

function SingleCountryView(country) {
    return (
        viewCountries &&
        <div className='single-country-view'>
            <div className='simgle-country-view-top'>
                <div className='country-view-display'>
                    <img src={viewCountries.additional_info.flag_path}/>
                    <h4>{viewCountries.name}</h4>
                </div>
                <div className='display-map-container'></div>
            </div>
        </div>
    )
}

export default CountryDisplayComponent;
